function App() {
  return <HashRouter>
    <Naviation></Naviation>
    <Route path="/" exact={true} component={Home}>
    </Route>
    <Route path="/about" component={About}></Route>
    <Route path="/movie-detail" component={Detail}>
    </Route>
  </HashRouter>
}

export default App;
